import React from 'react'

export const TodoItem = () => {
  let items = [
    {
      sno: 1,
      task: "job1",
      desc: "Do job1",
    },
    {
      sno: 2,
      task: "job2",
      desc: "Do job2"
    },
    {
      sno: 3,
      task: "job3",
      desc: "Do job3"
    }
  ]

  return (
    <div>
      <h1> {items[0].sno} </h1>
    </div>
  )
}
